import React from 'react';

function Nav() {
    return (
        <header className="header">
            <div className="topContianer">
                <div className="title">
                    <h1>Project</h1>
                </div>
                <div className="top-bar">
                    <a href="/">로그인</a>
                    <a href="/">마이페이지</a>
                    <a href="/">이미지</a>
                </div>
            </div>
        </header>
    );
}

export default Nav;
